l Committee must listen to the grassroots of the party.\n\u2014\nWe are running out of time. We've kicked the can down the road for too long. The climate crisis merits a full discussion of our plans, not a short exchange of talking points. The next President must make defeating this crisis the top priority of the nation. And I will continue to do everything I humanly can to ensure the climate crisis is at the top of the national agenda."}}]},"shortcode":"ByV_q4vgIrC","edge_media_to_comment":{"count":159},"comments_disabled":false,"taken_at_timestamp":1559771182,"dimensions":{"height":1080,"width":1080},"display_url":"https://scontent-lga3-1.cdninstagram.com/vp/5165fafa72501f9dccfe1b3dcb59be37/5D967636/t51.2885-15/e35/s1080x1080/61826276_913420145685518_3263649203451051307_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","edge_liked_by":{"count":1178},"edge_media_preview_like":{"count":1178},"location":null,"gating_info":null,"media_preview":null,"owner":{"id":"10361579608","username":"jayinslee"},"thumbnail_src":"https://scontent-lga3-1.cdninstagram.com/vp/be68babc00c9e8b4d26872f04bb0eb4b/5D7F9C81/t51.2885-15/sh0.08/e35/s640x640/61826276_913420145685518_3263649203451051307_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","thumbnail_resources":[{"src":"https://scontent-lga3-1.cdninstagram.com/vp/922c8f92cc08c987395857c84f24353e/5D81A626/t51.2885-15/e35/s150x150/61826276_913420145685518_3263649203451051307_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","config_width":150,"config_height":150},{"src":"https://scontent-lga3-1.cdninstagram.com/vp/e3f22646ed999e89738c0c931604158c/5D7BF26C/t51.2885-15/e35/s240x240/61826276_913420145685518_3263649203451051307_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","config_width":240,"config_height":240},{"src":"https://scontent-lga3-1.cdninstagram.com/vp/58473d0400d2109551babac9c674712b/5D84D1D6/t51.2885-15/e35/s320x320/61826276_913420145685518_3263649203451051307_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","config_width":320,"config_
